import React from "react";
impor
import Intro from "./Intro/intro";
import Stuff from "./Stuff/stuff";
import Heading from "./heading";
import Skill from "./Skills/skills";
import './App.css';

function App() {
  return (
    <>

      <Intro />
      <Heading text="About Me" />
      <Stuff />
      <Heading text="My Skills" />
      <Skill />
    </>
  );
}

export default App;
